import posts from '../posts.json'
import Link from 'next/link'

export default () => (
	<div>
		<h1>Blog</h1>
		<ul>
			{
				Object.entries(posts).map((value, index) => (
					<li key={index}>
						<Link href="/blog/[id]" as={'blog/' + value[0]}>
							<a>{JSON.stringify(value)}</a>
						</Link>
					</li>
				))
			}
		</ul>
	</div>
)

